import React, { Component } from 'react';
import Container from '@material-ui/core/Container';
import AppBar from '@material-ui/core/AppBar';

class MainPage extends Component{
    render(){
        return (
            <Container maxWidth='sm'>
                <AppBar/>
            </Container>
        )
    }
}

export default MainPage
